import './App.css';

const  App = () => {
  const [currDateTime, setCurrDateTime] = useState(new Date());
  useEffect(() => {
    setInterval(() => {
      setCurrDateTime(new Date())
    }, 1000*60);
  },[])
  return (
    <div className="App">
      {currDateTime.toLocaleTimeString()}

    </div>
  );
}

export default App;
